function Button(props) {
  const position = "py-1.5 px-5";
  const design = "bg-gray-900 text-white rounded-3xl";

  return (
    <button className={`${position} ${design}`} onClick={props.onClick}>
      {props.text}
    </button>
  );
}

export default Button;
